import { createStore } from 'vuex';
import requestModule from './request.module';
import userModule from './user.module';

export default createStore({
    state () {
        return {
            isAuthenticated: false
        }
        
    },
    mutations: {
        authenticate(state) {
            state.isAuthenticated = !state.isAuthenticated;
        }
    },
    actions: {},
    modules: {},
});
